import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

export default class extends React.Component {
    render() {
        return (
            <div className='contenedor'>
                <div className='row'>
                    <div className='img'>Hola</div>
                    <div>Fabricio</div>
                </div>
                <style jsx>{`
                    .contenedor{
                        width: 80%;
                        height: 70%;
                        border: 1px solid;
                        padding: 0;
                        justify-content: center;
                        align-items: center;
                        display: flex;
                        margin-right: -85px;
                    }

                    .img{
                        border: 1px solid;
                    }


                `}</style>
            </div>
        );
    }
}
